import fs from "fs";
import path from "path";
import { v4 as uuidv4 } from "uuid";
import dbClient from "../utils/db";
import { ObjectID } from "mongodb";

const FOLDER_PATH = process.env.FOLDER_PATH || "/tmp/files_manager";

const FilesController = {
  async validateUser(request) {
    const token = request.header("X-Token");
    const key = `auth_${token}`;
    try {
      const userId = await redisClient.get(key);
      if (userId) {
        const users = dbClient.db.collection("users");
        const idObject = new ObjectID(userId);
        const user = await users.findOne({ _id: idObject });
        if (!user) {
          return null;
        }
        console.log(user);
        return user;
      }
    } catch (error) {
      console.log(`Error ${error}`);
      return null;
    }
  },

  async postUpload(req, res) {
    const user = await FilesController.validateUser(req);
    if (!user) {
      return response.status(401).json({ error: "Unauthorized" });
    }

    const { name, type, parentId = "0", isPublic = false, data } = req.body;

    if (!name) {
      return res.status(400).json({ error: "Missing name" });
    }

    if (!type || !["folder", "file", "image"].includes(type)) {
      return res.status(400).json({ error: "Missing or invalid type" });
    }

    if (type !== "folder" && !data) {
      return res.status(400).json({ error: "Missing data" });
    }

    if (parentId !== "0") {
      const parentFile = await dbClient.client
        .db()
        .collection("files")
        .findOne({ parentId: parentId });

      if (!parentFile) {
        return res.status(400).json({ error: "Parent not found" });
      }

      if (parentFile.type !== "folder") {
        return res.status(400).json({ error: "Parent is not a folder" });
      }
    }

    const fileName = uuidv4();

    const localPath = path.join(FOLDER_PATH, fileName);

    if (type !== "folder") {
      const fileData = Buffer.from(data, "base64");
      fs.writeFile(localPath, fileData, (err) => {
        if (err) {
          throw err;
        }
        console.log("Data saved successfully!");
      });
    }

    const newFile = {
      userId: user._id,
      name,
      type,
      isPublic,
      parentId,
      localPath: type !== "folder" ? localPath : null,
    };

    try {
      const result = await dbClient.client
        .db()
        .collection("files")
        .insertOne(newFile);

      const createdFile = {
        id: result.insertedId,
        ...newFile,
      };

      return res.status(201).json(createdFile);
    } catch (error) {
      return res.status(500).json({ error: "Internal Server Error" });
    }
  },

  async getShow(req, res) {
    const user = await FilesController.validateUser(req);
    if (!user) {
      return res.status(401).json({ error: "Unauthorized" });
    }
    const { id } = req.params;

    const ObjectId = new ObjectId(id);
    const file = await dbClient.client
      .db()
      .collection("files")
      .findOne({ _id: ObjectId, userId: user.id });

    if (!file) {
      return res.status(404).json({ error: "Not found" });
    }

    return res.status(200).json(file);
  },
};

export default FilesController;
